// src/components/ChairWelcomeSection.js
import React from 'react';
import './ChairWelcomeSection.css';
import chairperson from '../images/chairperson.jpg';

function ChairWelcomeSection() {
  return (
    <section className="chair-welcome">
      <div className="container">
        <h2>Chairperson's Welcome</h2>
        <img src={chairperson} alt="Chairperson" className="chair-img" />
        <p>
          As the Chairperson of the National Society of Black Engineers (NSBE), it is my honor to welcome you to our vibrant community...
        </p>
      </div>
    </section>
  );
}

export default ChairWelcomeSection;
